import React, { useState } from "react";
import {
  AppBar,
  Button,
  Container,
  Drawer,
  IconButton,
  List,
  ListItemButton,
  ListItemText,
  Tab,
  Tabs,
  Toolbar,
  Typography,
  useMediaQuery,
  useTheme,
  Badge
} from "@mui/material";
import AddBusinessRoundedIcon from "@mui/icons-material/AddBusinessRounded";
import MenuIcon from "@mui/icons-material/Menu";
import { NavLink } from "react-router-dom";


const Navbar = () => {
  const [value, setValue] = useState();
  const [openDrawer, setOpenDrawer] = useState(false);
  const theme = useTheme();
  const isMatch = useMediaQuery(theme.breakpoints.down("md"));

  return (
    <React.Fragment>
      <AppBar sx={{ background: "#f5f5fd", color: "black", boxShadow: "none",height:'70px'}}>
        <Container maxWidth="xl">
          <Toolbar>
            <AddBusinessRoundedIcon
              sx={{ transform: "scale(2)", color: "#6b3bc4" }}
            />
            <Typography
              sx={{
                color: "#6b3bc4",
                fontSize: "2rem",
                paddingLeft: "2%",
                display: { xs: "none", md: "flex" },
              }}
            >
              Payakon
            </Typography>
            {isMatch ? (
              <>
                <Typography
                  sx={{ color: "#6b3bc4", fontSize: "2rem", paddingLeft: "3%" }}
                >
                  Payakon
                </Typography>
                <IconButton
                  sx={{ color: "black", marginLeft: "auto" }}
                  onClick={() => setOpenDrawer(!openDrawer)}
                >
                  <MenuIcon color="black" />
                </IconButton>
                <Drawer
                  anchor="left"
                  open={openDrawer}
                  onClose={() => setOpenDrawer(false)}

                >
                  <List sx={{width:'200px',textDecoration: 'none'}}>
                  <ListItemButton sx={{padding:'10px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/'><ListItemText>Home</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'10px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/products'><ListItemText>Products</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'10px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/cart'><ListItemText>Cart</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'10px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/about'><ListItemText>About</ListItemText></NavLink>
                    </ListItemButton>
                    <ListItemButton sx={{padding:'10px',"&:hover":{color:'#6b3bc4',backgroundColor:'#f5f5fd'}}}>
                    <NavLink to='/contact'><ListItemText>Contact</ListItemText></NavLink>
                    </ListItemButton>
                    {/* Add similar ListItemButton components for other items */}
                  </List>
                </Drawer>
              </>
            ) : (
              <>
                <Tabs
                  sx={{ marginLeft: "auto" }}
                  indicatorColor="secondary"
                  textColor="inherit"
                  value={value}
                  onChange={(e, value) => setValue(value)}
                >
                  <NavLink to='/'><Tab sx={{"&:hover":{fontWeight:'bold'}}} label="Home" /></NavLink>
                  <NavLink to='/products'><Tab sx={{"&:hover":{fontWeight:'bold'}}} label="Products" /></NavLink>
                  <NavLink to='/cart'><Badge badgeContent={0} color="primary"></Badge></NavLink>
                  <NavLink to='/about'><Tab sx={{"&:hover":{fontWeight:'bold'}}} label="About" /></NavLink>
                  <NavLink to='/contact'><Tab sx={{"&:hover":{fontWeight:'bold'}}} label="Contact" /></NavLink>
                </Tabs>
                <Button
                  sx={{
                    marginLeft: "auto",
                    backgroundColor: "#6b3bc4",
                    color: "white",
                    "&:hover": { backgroundColor: "#5931a3" },
                  }}
                  variant="contained"
                >
                  Login
                </Button>
              </>
            )}
          </Toolbar>
        </Container>
      </AppBar>
    </React.Fragment>
  );
};

export default Navbar;
